/**
  * @brief  The application entry point.
  * @retval int
  */
int main(void)
{

  /* USER CODE BEGIN 1 */

  /* USER CODE END 1 */

  /* MCU Configuration--------------------------------------------------------*/

  /* Reset of all peripherals, Initializes the Flash interface and the Systick. */
  HAL_Init();

  /* USER CODE BEGIN Init */

  /* USER CODE END Init */

  /* Configure the system clock */
  SystemClock_Config();

  /* USER CODE BEGIN SysInit */

  /* USER CODE END SysInit */

  /* Initialize all configured peripherals */
  MX_GPIO_Init();
  MX_DMA_Init();
  MX_TIM14_Init();
  MX_USART2_UART_Init();
  MX_FATFS_Init();
  MX_USB_HOST_Init();
  MX_SPI3_Init();
  MX_TIM13_Init();
  MX_ADC1_Init();
  MX_TIM11_Init();
  MX_TIM10_Init();
  MX_TIM7_Init();
  /* USER CODE BEGIN 2 */
  HAL_TIM_Base_Start_IT(&htim10); // Paleidziame LGVL sistemos laikmati
  HAL_TIM_Base_Start_IT(&htim13); // Leidziame update'inti label'ius tik juos pirma sukurus
  HAL_TIM_Base_Start_IT(&htim14); // Paleidziame GNSS nuskaityma
  HAL_TIM_Base_Start_IT(&htim7);// ADC nuskaitymo intervalai
  LVGL_Task();
  /* USER CODE END 2 */

  /* Infinite loop */
  /* USER CODE BEGIN WHILE */
  while (1)
  {
    /* USER CODE END WHILE */
    MX_USB_HOST_Process();

    /* USER CODE BEGIN 3 */


    if(data_To_Save[0] != '\0'){ //Patikriname ar turime ka issaugoti i flesh drive'a
    	if(!is_File_Created){
			MSC_Application("Latitude;Longitude;Signal Level in dBm\n", sizeof("Latitude;Longitude;Signal Level in dBm\n"), 1); // Mode 1 reiskia, kad failas yra kuriamas is naujo
			MSC_Application(data_To_Save,sizeof(data_To_Save), 2); // Mode 2 reiskia, kad failas yra appendinamas
			is_File_Created = 1;
		}
		else{
			MSC_Application(data_To_Save,sizeof(data_To_Save), 2); // Mode 2 reiskia, kad failas yra appendinamas
		}
    	memset(data_To_Save, 0, sizeof(data_To_Save)); // Irase i flash'a duomenis is masyvo istriname, kad nerasytume daugiau nei viena karta
    }

    if(is_It_Time_To_Update_Labels){
    	update_Labels();
    	is_It_Time_To_Update_Labels = 0;
    }
  }
  /* USER CODE END 3 */
}

