void Process_GNGGA_Sentence(uint8_t* buffer, uint16_t length) {
    uint16_t j = 0;
    uint8_t is_gngga_found = 0;
    float latitude = 0.0f, longitude = 0.0f;

    // Ieskome "GNGGA" sakinio pradzios
    for (int i = 0; i < length - GNGGA_Char_Amount; i++) {
        if (buffer[i] == 'G' && buffer[i+1] == 'N' && buffer[i+2] == 'G' && buffer[i+3] == 'G' && buffer[i+4] == 'A') {
        	//Patikriname ar tikrai atejo duomenys. Gali buti ilgos kableliu sekos, kurios reiskia, kad nera duomenu
        	//Dazniausiai pasitaiko, kad turime daug kableliu, vienas po kito, iskarto po GNNGA zodzio arba po pirmojo duomens
        	//Del to patikriname ar koordinaciu vietoje nera idetas kablelis ir ar tiesiai po "GNNGA," nera dar vieno kablelio
        	if(buffer[i + Lat_Start_Index_In_Sentece] != ',' && buffer[i + GNGGA_Char_Amount + 1] != ','){
        		is_GPS_Signal_Received = 1;
        		is_gngga_found = 1;
        		j = 0;
        	}
        	else{
        		is_GPS_Signal_Received = 0;

        		break;
        	}
        }

        if (is_gngga_found) {
            GNGGA_sentences[sentence_count][j++] = buffer[i];
            if (buffer[i] == '\n') {
                GNGGA_sentences[sentence_count][j] = '\0';

                int lat_deg, lon_deg;
                float lat_deg_frac, lon_deg_frac;

                // Isgauti latitude ir longitude i  sakinio
                char lat_str[Lat_String_Length], lon_str[Lon_String_Length];
                strncpy(lat_str, GNGGA_sentences[sentence_count] + Lat_Start_Index_In_Sentece, Lat_String_Length);   // Latitude dalis (ddmm.mmmmm)
                strncpy(lon_str, GNGGA_sentences[sentence_count] + Lon_Start_Index_In_Sentece, Lon_String_Length);  // Longitude dalis (dddmm.mmmmm)

                lat_deg = 10*char_to_Int(lat_str[0]) + char_to_Int(lat_str[1]); // minutes
                lat_deg_frac = 	(10*char_to_Int(lat_str[2]) + char_to_Int(lat_str[3]) +
                				0.1f*char_to_Int(lat_str[5]) + 0.01f*char_to_Int(lat_str[6]) +
								0.001f*char_to_Int(lat_str[7]) + 0.0001f*char_to_Int(lat_str[8]) +
								0.00001f*char_to_Int(lat_str[9]))/60; // minutes trupmenine dalis

                latitude = lat_deg + lat_deg_frac;

                lon_deg = 100*char_to_Int(lon_str[0]) + 10*char_to_Int(lon_str[1]) + char_to_Int(lon_str[2]); // minutes
                lon_deg_frac = 	(10*char_to_Int(lon_str[3]) + char_to_Int(lon_str[4]) +
                				0.1f*char_to_Int(lon_str[6]) + 0.01f*char_to_Int(lon_str[7]) +
								0.001f*char_to_Int(lon_str[8]) + 0.0001f*char_to_Int(lon_str[9]) +
								0.00001f*char_to_Int(lon_str[10]))/60; // minutes trupmenine dalis

                longitude = lon_deg + lon_deg_frac;

                // Koreguojame pagal krypti
                if (lat_str[11] == 'S') {
                    latitude = -latitude;
                }
                if (lon_str[12] == 'W') {
                    longitude = -longitude;
                }

                //Isirasome koordinates

                Current_Coordinates.latitude = latitude;
                Current_Coordinates.longitude = longitude;

                if (is_USB_Connected && is_Recording){
                	sprintf(data_To_Save,"%.7f;%.7f;%d\n",latitude,longitude, Current_Signal_Level_in_dBm);
            	}

                break;
            }
        }
    }
}

