void HAL_GPIO_EXTI_Callback(uint16_t GPIO_Pin){

	if(is_Button_Debouncing_Time_Passed == 1){
		if(GPIO_Pin == 64){ // Set_Amp_Number
			if(Number_Of_Amps_Turned_On <2){
				Number_Of_Amps_Turned_On++;
			}
			else{
				Number_Of_Amps_Turned_On = 0;
			}
			// Turn on the required Amps
			if(Number_Of_Amps_Turned_On == 0){
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_2, GPIO_PIN_RESET);
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_3, GPIO_PIN_RESET);
			}
			if(Number_Of_Amps_Turned_On == 1){
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_2, GPIO_PIN_SET);
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_3, GPIO_PIN_RESET);
			}
			if(Number_Of_Amps_Turned_On == 2){
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_2, GPIO_PIN_SET);
				HAL_GPIO_WritePin(GPIOC, GPIO_PIN_3, GPIO_PIN_SET);
			}
		}
		if(GPIO_Pin == 128){ // Start_Stop_Recording
			is_Recording++;
			is_Recording %=2;
		}
		is_Button_Debouncing_Time_Passed = -1;
		HAL_TIM_Base_Start_IT(&htim11);
	}
}

void HAL_ADC_ConvCpltCallback(ADC_HandleTypeDef* hadc) {
    if (hadc->Instance == ADC1) {

    	// Stumiame signalu vertes i kaire
    	for(int i=0;i<Signal_Average_Count-1;i++){
    		Recent_Signal_Levels[i] = Recent_Signal_Levels[i+1];
    	}
    	// Pridedame nauja verte i desine
        Recent_Signal_Levels[Signal_Average_Count-1] = ADC_Values[0];
        // Skaiciuojame vidurki

        Current_Signal_Level = 0;

    	for(int i=0;i<Signal_Average_Count;i++){
    		Current_Signal_Level += Recent_Signal_Levels[i];
    	}
    	Current_Signal_Level /= Signal_Average_Count;
    	//Konvertuojame i dBm
    	Calculate_Signal_Level_in_dBm(Current_Signal_Level*3300/4096, Number_Of_Amps_Turned_On);


    }
}

